import ExpenseDate from "./ExpenseDate";

function ExpensesItem(props){
  return (
    <div className="expenses-item">
      <ExpenseDate date={props.date}/>
      <div className="expense-item_description"> 
        <h2>{props.title}</h2>
        
      </div>
    </div>
  )
}

export default ExpensesItem;
